import React from 'react'
import { Link } from 'react-router-dom'
import './Header.css'

function Header() {
    return (
        <nav className='header'>
            {/* Logo here */}
            <Link>
                <img src='http://pngimg.com/uploads/amazon/amazon_PNG11.png' className='header__logo' />
            </Link>
            {/* Search Field */}
        </nav>
    )
}

export default Header
